{
  "version": "0.2",
  "phases": {
    "pre_build": {
      "commands": [
        "cd deploy",
        "npm install -g aws-cdk",
        "gem install cfn-nag",
        "pip install -r requirements.txt"
      ]
    },
    "build": {
      "commands": [
        "cdk synth",
        "mkdir ./cfnnag_output",
        "for template in $(find ./cdk.out -type f -maxdepth 2 -name '*.template.json'); do cp $template ./cfnnag_output; done",
        "cfn_nag_scan --input-path ./cfnnag_output",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "deploy/cdk.out",
    "files": "**/*"
  }
}

{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "set -eu",
        "env | grep REACT",
        "npm i react-scripts",
        "npm run build",
        "npm run deploy"
      ]
    }
  }
}
